import React from "react";
import './css/question.css';
import Question from "./Question";
import  CircularProgressbar  from "../components/circularProgress";
class Qlist extends React.Component{
    constructor(){
        super();
        this.state={
            qnum:0
        }
    }
    next=()=>{
        this.setState({qnum: this.state.qnum+1});
    }
    render(){
        const ques= [{
            question:"Which of the following is B in ASL?",
            a:{
                type:"image",
                data:"https://thumbnail.imgbin.com/7/20/25/imgbin-american-sign-language-letter-fingerspelling-others-nYZjXkKWE2bAPxbSpby5sD467_t.jpg"
            },
            b:{
                type:"image",
                data:"https://www.pinclipart.com/picdir/middle/6-64347_clipart-sign-language-letter-png-download.png"
            },
            c:{
                type:"image",
                data:"https://img.favpng.com/14/19/15/american-sign-language-letter-b-png-favpng-L9Du3W0bNcpet0YCPqvrj7Vye.jpg"
            },
            d:{
                type:"image",
                data:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR2OO17qWMLPvwLDCZmytnc3ppT-16eicy4Rg&usqp=CAU"
            },
            answer:"C"
        },{
            question:"Which of the following is I in ASL?",
            a:{
                type:"image",
                data:"https://thumbnail.imgbin.com/7/20/25/imgbin-american-sign-language-letter-fingerspelling-others-nYZjXkKWE2bAPxbSpby5sD467_t.jpg"
            },
            b:{
                type:"image",
                data:"https://www.pinclipart.com/picdir/middle/6-64347_clipart-sign-language-letter-png-download.png"
            },
            c:{
                type:"image",
                data:"https://img.favpng.com/14/19/15/american-sign-language-letter-b-png-favpng-L9Du3W0bNcpet0YCPqvrj7Vye.jpg"
            },
            d:{
                type:"image",
                data:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR2OO17qWMLPvwLDCZmytnc3ppT-16eicy4Rg&usqp=CAU"
            },
            answer:"B"
        },{
            question:"Which of the following is B in ASL?",
            a:{
                type:"image",
                data:"https://thumbnail.imgbin.com/7/20/25/imgbin-american-sign-language-letter-fingerspelling-others-nYZjXkKWE2bAPxbSpby5sD467_t.jpg"
            },
            b:{
                type:"image",
                data:"https://www.pinclipart.com/picdir/middle/6-64347_clipart-sign-language-letter-png-download.png"
            },
            c:{
                type:"image",
                data:"https://img.favpng.com/14/19/15/american-sign-language-letter-b-png-favpng-L9Du3W0bNcpet0YCPqvrj7Vye.jpg"
            },
            d:{
                type:"image",
                data:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR2OO17qWMLPvwLDCZmytnc3ppT-16eicy4Rg&usqp=CAU"
            },
            answer:"C"
        }]
        return(
            <div>
                 <CircularProgressbar value={this.state.qnum*10}/>
                <Question answer= {ques[this.state.qnum].answer} num={this.state.qnum} question={ques[this.state.qnum].question} a={ques[this.state.qnum].a} b={ques[this.state.qnum].b} c={ques[this.state.qnum].c} d={ques[this.state.qnum].d}/>
                <button className="btn btn-success" onClick={this.next}>Next</button>
            </div>
            
        )
    }
}
export default Qlist;
